import Task from './Task'

const Tasks = ({task, onDelete}) => {
  return (
    <>
      {
        tasks.map(task => {
          return (
            <Task
              key={task.id}
              task={task}
              isDeleting={props.onDelete}
              change={props.change}
            />
          )
        })
      }
    </>
  )
}

export default Tasks
